import React from "react";
import logo from "./logos/logo.png";

const Header = () => {
    return <>

        <div className="header">
            <img src={logo} alt="Logo" width="120px"/>
            <input className="toggel" type="checkbox" id="checkbox"/><label className="leble" for="checkbox"><span className="ball"></span></label>
        </div>

    </>

};
 
export default Header;
